import React, {Suspense, useEffect} from 'react';
import './uiContainer.css';
import {pushExample} from './designed_ui/pushExample/pushExample.jsx';

function UiContainer() {

    useEffect(() => { 
  
      
    })
  
    return (
    <>
    <div class='container body'>
        <section class='top row last-push submit status container'>
            {['1','2','3'].map((item,i) =>{
                return <div key={i} className="grow-item ui-block"><span style={{fontSize: "2rem"}}>{`Push block ${item}`}</span></div>;
            })}
        </section>

        <section class='top row last-push submit status container'>
            {[<pushExample/>].map((item,i) =>{
                return <div key={i}>{item}</div>
                //return <div key={i} className="grow-item ui-block"><span style={{fontSize: "2rem"}}>{`Push block ${item}`}</span></div>;
            })}
        </section>

        <section class='bottom row last-push log delete-all'>
            {['4','5','6'].map((item,i) =>{
                return <div key={i} className="grow-item ui-block"><span style={{fontSize: "2rem"}}>{`Push block ${item}`}</span></div>;
            })}
        </section>
    </div>
  
    </>
    );
  }

  export {UiContainer}
